Singapore 1942: End of Empire


70th-anniversary television event telling the story of the fall of Singapore in 1942. 

The BBC has produced this very good docu-drama about the Japanese assault on Malaya and Singapore in 1941/42. For some reason it was only shown on BBC Two Scotland.


Winx HQ 1500/160k

